import React, { useState, useEffect } from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './css/App.css';
import NavBar from './components/NavBar';
import Home from './components/Home';
import About from './components/About';

function App() {
  return (
    <BrowserRouter>
    <div className="App container flexed">
      <NavBar></NavBar>
      <Home></Home>

    </div>
    </BrowserRouter>
  );
}

export default App;
